const docs = {
    getAllDocs: async function getAllDocs() {
        let a = `${URL}/docs`;
        console.log("helo world");
        console.log("url is "+ a);
        const response = await fetch(`${URL}/docs`);
        const result = await response.json();

        return result.data;
    },
};

export default docs;
